import React from 'react';
import Head from "next/head";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { slide as Menu } from 'react-burger-menu';

import '../styles/normalize.scss';
import '../styles/global.scss';

function HomePage() {
  return (
    <div>
      <Head>
        <title>Welcome</title>
      </Head>
      <Menu>
        <a href=""><FontAwesomeIcon icon="coffee" /><span>Favorites</span></a>
        <a href=""><i className="fas fa-fw fa-bell-o" /><span>Alerts</span></a>
        <a href=""><i className="fas fa-fw fa-envelope-o" /><span>Messages</span></a>
        <a href=""><i className="fas fa-fw fa-comment-o" /><span>Comments</span></a>
        <a href=""><i className="fas fa-fw fa-bar-chart-o" /><span>Analytics</span></a>
        <a href=""><i className="fas fa-fw fa-newspaper-o" /><span>Reading List</span></a>
      </Menu>
      Welcome to Next.js!
    </div>
  )
}

export default HomePage
